import { FormControl, InputLabel ,InputAdornment,Input,Select,MenuItem} from "@mui/material"
import React from "react"


function InputElement(data){
        const {isRequired,labelName,type,icon,handleCallback,value,id}=data
        return <FormControl>
                    <InputLabel required={isRequired?true:false}>{labelName}</InputLabel>
                    <Input  startAdornment={<InputAdornment position="start"> {icon}</InputAdornment>}
                            type={type} id={id} onInput={handleCallback}  value={value}
                        />
            </FormControl>
}


function SelectElement(data){
        const {isRequired,list,handleCallback,isObject,labelName}=data
        return <FormControl variant="standard"  >
                <InputLabel required={isRequired?true:false}>{labelName}</InputLabel>
                <Select onChange={handleCallback}>
                    {
                        isObject?
                        list.map(l=>
                            <MenuItem value={l.value}>{l.label}</MenuItem>
                        )
                        :
                        list.map(l=>
                            <MenuItem value={l}>{l}</MenuItem>
                        )
                    }
                </Select>
        </FormControl>
}

export {
    InputElement,
    SelectElement
}
